suApp.model.MapModel=Backbone.Model.extend({defaults:{location:new google.maps.LatLng(59.364213,18.058383),currentPosition:null,mapPosition:new google.maps.LatLng(59.364213,18.058383),zoom:15},setLocation:function(a,b){this.set({location:new google.maps.LatLng(a,b)})},setMapPosition:function(a,b){this.set({mapPosition:new google.maps.LatLng(a,b)})},setZoom:function(a){this.set({zoom:a})}});